A program with all the laughs that can be crammed into two hours of non-stop merriment. Join us on this rip roaring trip through the world of cinema comedy 

Here it is! With the centennial of the invention of Motion Pictures comes a program with all the laughs that can be crammed into two hours of non-stop merriment.

Journey on a rip-roaring trip through the world of cinema comedy, with the funniest moments in the history of Hollywood, from slapstick of the silents through the screwball comedies of the 1930's and '40's to the red hot hijinks of Hollywood's most recent comedies!

All the great movie comics are here, from the great comic actors of the past to the laughmakers of today. Here are profiles of all your favorite comedy stars, plus revealing looks at some of the 'forgotten' comics of the silent and Talkie era. You see the great classic comedians, including: Laurel and Hardy, the Marx Brothers, the Three Stooges, Mae West, W.C. Fields, Charlie Chaplin, and numerous others. Also covered are the comedy superstars of today, including Bill Murray, Eddie Murphy, Jim Carrey, Cassandra 'Elvira' Peterson and many more!

Here are scenes from the funniest films ever made, including such silent classics as The Gold Rush, the General, and The Extra Girl, classic screwball comedies such as His Girl Friday, Dinner at Eight, It Happened One Night, and Bringing up Baby, and the riotous humor of It's A Mad, Mad, Mad, Mad World, Blazing Saddles, Young Frankenstein, Beetlejuice, Bill and Ted's Excellent Adventure and dozens more! Plus rare early movie comedy behind the scenes footage, foreign film fun, mockumentaries, musical comedies and the unintentional hilarity of movies like Reefer Madness. 100 Stars provide hundreds of laughs for a century of a fun-filled film fest.


